Accounts_CustomFields_Description:
புலம் அமைப்புகள் ஒரு அகராதி கொண்டிருக்கும் புலம் பெயர்கள் எங்கே ஒரு சரியான JSON இருக்க வேண்டும். எடுத்துக்காட்டு: <br/><code>{
"பாத்திரம்": {
"வகை": "தேர்ந்தெடு",
"defaultValue": "மாணவர்",
"விருப்பங்கள்": ["ஆசிரியர்", "மாணவர்"],
"தேவை": உண்மை,
"modifyRecordField": {
"வரிசை": உண்மை,
"புலம்": "பாத்திரங்கள்"
}
},
"ட்விட்டர்": {
"வகை": "உரை",
"தேவை": உண்மை,
"minLength": 2,
"maxLength": 10
}
}</code>

Custom_Translations_Description:
விசைகள் விசை மற்றும் மொழிபெயர்ப்புகளின் ஒரு மொழியைக் கொண்டுள்ள மொழிகளில் எங்கே சரியான JSON ஆக இருக்க வேண்டும். எடுத்துக்காட்டு: <br/><code>{
"en": {
"சேனல்கள்": "அறைகள்"
},
"pt": {
"சேனல்கள்": "சலாஸ்"
}
}</code>
